function block_tech_stack(){let a=document.querySelectorAll(".tech_stack_btn");a.forEach(t=>t.addEventListener("click",t=>{!function(t){console.log(t.target.dataset.cat);let e=document.querySelectorAll(".tech_stack-logos"),c=Array.from(e);c.forEach(t=>t.classList.add("d-none")),showDiv=document.querySelector(".wrapper-"+t.target.dataset.cat),showDiv.classList.remove("d-none")}(t),function(t){let e=Array.from(a);e.forEach(t=>t.classList.remove("active"));let c=t.target;c.classList.add("active")}(t)}))}"loading"!==document.readyState?block_tech_stack():document.addEventListener("DOMContentLoaded",()=>block_tech_stack());